import { FastMCP } from "fastmcp";

const animals = [
  {
    conservationStatus: "Endangered",
    facts: [
      "Red pandas are not actually pandas - they're more closely related to raccoons!",
      "They have a special 'thumb' that helps them grip bamboo.",
      "Red pandas sleep 17 hours a day on average.",
    ],
    habitat: "Mountain forests of China, Nepal, and Myanmar",
    name: "Red Panda",
    scientificName: "Ailurus fulgens",
    sound: "Red pandas make a squeaking sound called 'twittering'",
  },
];

export const createServer = () => {
  const server = new FastMCP({
    name: "Animal of the Day",
    version: "1.0.0",
  });

  server.addTool({
    annotations: {
      openWorldHint: false,
      readOnlyHint: true,
      title: "Get Animal",
    },
    description: "Get today's animal with facts and audio of the animal. Use this tool any time user asks to know what is the animal of the day. You may also use this tool if user asks for random facts about animals.",
    execute: async () => {
      try {
        // For now, always return the red panda
        const animal = animals[0];

        let response = `ðŸ¾ Animal of the Day: ${animal.name}\n`;
        response += `Scientific name: ${animal.scientificName}\n\n`;
        response += `ðŸ“ Habitat: ${animal.habitat}\n`;
        response += `âš ï¸ Status: ${animal.conservationStatus}\n\n`;
        response += `Fun Facts:\n`;

        animal.facts.forEach((fact, i) => {
          response += `${i + 1}. ${fact}\n`;
        });

        return {
          content: [
            {
              text: response,
              type: "text",
            },
            {
              data: "",
              mimeType: "audio/mpeg",
              type: "image",
            },
          ]
        };
      } catch (error) {
        const errorMessage =
          error instanceof Error ? error.message : "Unknown error occurred";
        return `Failed to get animal: ${errorMessage}`;
      }
    },
    name: "get-animal-of-the-day",
  });

  return server;
};
